import * as React from 'react';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';

export default function MediaCard() {
  return (
    <Card sx={{ maxWidth: 345 }}>
      <CardActionArea>
        <CardMedia
          component="img"
          height="440"
          image="https://raw.githubusercontent.com/SJCMN/LocationList-Prime/master/public/Screen%20Shot%202021-12-04%20at%2011.29.38%20PM.png"
          alt="location list screen shot"
          // src="app/public/Media/LocationList Prezo 20 ns.mov"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="div">
            Location List
          </Typography>
          <Typography variant="body2" color="text.secondary">
            Location List is a mobile grocery list app. Items are sorted by distance from you and update while you shop.
          </Typography>
        </CardContent>
      </CardActionArea>
    </Card>
  );
}
